import time, math

def binary_gcd(x, y):
    if x == 0:
        return y
    if y == 0:
        return x

    x_z = (x & -x).bit_length()-1
    y_z = (y & -y).bit_length()-1
    shift = min(x_z, y_z)
    y_z >>= y_z

    while x != 0:
        x >>= x_z
        diff = y-x
        x_z = (diff & -diff).bit_length()-1
        y = min(x, y)
        x = abs(diff)

    return y << shift

def binary_gcd_gpt(a, b):
    if a == b:
        return a
    if a == 0:
        return b
    if b == 0:
        return a

    if a&1 == 0:
        if b&1:
            return binary_gcd(a >> 1, b)
        else:
            return binary_gcd(a >> 1, b >> 1) << 1
    elif b&1 == 0:
        return binary_gcd(a, b >> 1)
    elif a > b:
        return binary_gcd((a - b) >> 1, b)
    else:
        return binary_gcd((b - a) >> 1, a)
    

    
